import React from 'react';
import './Profile.css';
import moment from 'moment';
import DeleteIcon from '@material-ui/icons/DeleteForeverOutlined';

function profile({ image, title, desc, addDate, gender, handleDeleteProfile, _id }) {
    return (
        <div className='videoCard'>
            <img className='videoCard_thumbnail' src={image} />
            <hr />
            <div className='videoCard_info'>
                <div className='videoCard_text'>
                    <h3>{title}</h3>
                    <p>{desc}</p>
                    <p>Added on : {addDate ? moment(addDate).format('YYYY-MM-DD') : ''}</p>
                    <div>Gender : {gender}</div>
                    <DeleteIcon className='delete_button' onClick={() => handleDeleteProfile(_id)} />
                </div>
            </div>
        </div>
    )
}

export default profile
